import React from 'react';
import imgFundo from '../img/galaxia.jpg';
import Texto from './Texto';
import Imagem from './Imagem';


export default function Galaxias(){
    return(
        <>
            <Texto 
                seuTexto={"As estrelas formam-se pela condensação de gases que se aglutinam pela atração gravitacional. \
                As grandes nebulosas, por exemplo são “berçários” de estrelas, uma vez que, em seu interior, grandes nuvens moleculares "}
            />
            <Imagem imagens = {imgFundo} />
        </>
    );
}
